BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "testlog" (
	"id"	INTEGER NOT NULL,
	"a"	INTEGER,
	"t"	NUMERIC,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "metastatistics" (
	"id"	INTEGER NOT NULL,
	"default_kanji"	INTEGER,
	"default_tightness"	NUMERIC,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "testmaterial" (
	"id"	INTEGER NOT NULL,
	"kanji"	TEXT NOT NULL,
	"meaning"	TEXT NOT NULL,
	"onyomi"	TEXT,
	"kunyomi"	TEXT,
	"grade"	TEXT,
	"jlpt"	TEXT,
	"kanken"	TEXT,
	"frequency"	INTEGER,
	"my_rank"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "questionlog" (
	"id"	INTEGER NOT NULL,
	"testlogid"	INTEGER NOT NULL,
	"testmaterialid"	INTEGER NOT NULL,
	"score"	BOOLEAN,
	PRIMARY KEY("id"),
	FOREIGN KEY("testlogid") REFERENCES "testlog"("id"),
	FOREIGN KEY("testmaterialid") REFERENCES "testmaterial"("id"),
	CHECK(score IN (0,1))
);
COMMIT;
